russian_translator = Translator(to_lang="ru")
german_translator = Translator(to_lang="de")
serbian_translator = Translator(to_lang="srb")


def translate_rus(definition):
    print('Translating RU: ')
    if "/" in definition:
        acc = []
        for word in definition.split('/'):
            acc.append(russian_translator.translate(word))
        return " / ".join(acc)
    else:
        r = russian_translator.translate(definition)
        return r


def translate_srb(definition):
    print('Translating SRB: ')
    if "/" in definition:
        acc = []
        for word in definition.split('/'):
            acc.append(serbian_translator.translate(word))
        return "/".join(acc)
    else:
        r = serbian_translator.translate(definition)
        return r


def translate_germ(definition):
    print('Translating SRB: ')
    if "/" in definition:
        acc = []
        for word in definition.split('/'):
            acc.append(german_translator.translate(word))
        return "/".join(acc)
    else:
        r = german_translator.translate(definition)
        return r


