def isrussian(w):
    for char in w:
        if char in ascii_lowercase:
            return False
        else:
            return True


def clean_element(element):
    words = element.replace(';', '. ').replace(',', '. ').split('. ')
    unique_words = list(set([w for w in words if isrussian(w.lower())]))[:3]
    return '/'.join(unique_words)


rv = []
for i in russian_vector:
    rv.append(clean_element(i))

ru_df = pd.DataFrame(data={'ru_transl': rv})

